import React from 'react';
import { useNavigate } from 'react-router-dom';

const HomePage = () => {
  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <nav
  className="navbar navbar-expand-lg position-absolute top-0 w-100"
  style={{
    background: 'transparent',
    boxShadow: 'none',
    border: 'none',
    zIndex: 1000,
  }}
>
  <div className="container d-flex justify-content-between align-items-center">
    <div
      className="px-3 py-1 rounded-3 fw-bold shadow-sm"
      style={{
        backgroundColor: '#00796b',
        color: 'white',
        fontSize: '1.2rem',
      }}
    >
      ü©∫ HealthPredict
    </div>

    <div>
      {token ? (
        <button
          className="px-3 py-1 rounded-3 fw-bold shadow-sm border-0"
          style={{
            backgroundColor: '#00796b',
            color: 'white',
            fontSize: '0.95rem',
          }}
          onClick={handleLogout}
        >
          üîì Logout
        </button>
      ) : (
        <>
          <a
            className="px-3 py-1 rounded-3 fw-bold shadow-sm border-0 me-2"
            style={{
              backgroundColor: '#00796b',
              color: 'white',
              fontSize: '0.95rem',
            }}
            href="/login"
          >
            üîê Login
          </a>
          <a
            className="px-3 py-1 rounded-3 fw-bold shadow-sm border-0"
            style={{
              backgroundColor: '#00796b',
              color: 'white',
              fontSize: '0.95rem',
            }}
            href="/register"
          >
            üìù Register
          </a>
        </>
      )}
    </div>
  </div>
</nav>

  );
};

export default HomePage;
